import { Component, OnInit } from '@angular/core';
import { FrameInfo } from '../models/frame-info';

@Component({
  selector: 'app-bowling-score',
  templateUrl: './bowling-score.component.html',
  styleUrls: ['./bowling-score.component.css']
})
export class BowlingScoreComponent implements OnInit {

  frames: FrameInfo[] = [];
  frameData: FrameInfo = new FrameInfo();
  frameData2: FrameInfo = new FrameInfo();

  ngOnInit(): void {
    this.frameData.scores = [1, 2, 0];
    this.frameData.frameNumber = 1;

    this.frameData2.scores = [5, 1, 10];
    this.frameData2.frameNumber = 10;
    this.frameData2.isLastFrame = true;

    let frame: FrameInfo = new FrameInfo();
    frame.frameNumber = 1;
    frame.scores = [1, 2];
    frame.isLastFrame = false;
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 2;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 3;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 4;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 5;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 6;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 7;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 8;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 9;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 10;
    frame.scores = [3, 4];
    frame.isLastFrame = true;
    this.frames.push(frame);


  }

  calculateScore(): void {
    console.log("calculate score");
  }

}
<p>bowling-score works!</p>
<div class="container">
  <div class="row">
    <div *ngFor="let frame of frames" class="col-md-1 border">
      <div class="container-fluid">
        <app-frame [frame]="frame"></app-frame>
      </div>
    </div>
  </div>
  <div class="row">
    <div class="col-5">
      <button type="button" (click)="calculateScore()">Calculate Score</button>
    </div>
  </div>
</div>
